import "./App.css";
import React from "react";
import bg from "./images/bg.jpg";

function Moonproject() {
  return <div>#MoonProject</div>;
}

function App() {
  return (
    <div className="App" style={{ width: "100vw", height: "100vh" }}>
      <div
        style={{ width: "100vw", height: "80%" }}
        className="appbackgrounds"
      ></div>
    </div>
  );
}

export default App;
